import { Container, Grid } from '@mui/material';
import React from 'react'

const ProductDetail = () => {
  return (
    <>
    <Container>
        <Grid container spacing={{sx:0,md:2}}>
            <Grid item sx={12} md={6}> 
                left
            </Grid>
            <Grid item sx={12} md={6}>
                right
            </Grid>
        </Grid>
    </Container>
    </>
  )
}

export default ProductDetail;
